import re
import matplotlib.pyplot as plt

# Function to extract coordinates from LINESTRING data
def extract_coordinates(linestring):
    """
    Extracts coordinates from a LINESTRING input.
    :param linestring: A string containing the LINESTRING data.
    :return: List of coordinate tuples [(x1, y1), (x2, y2), ...]
    """
    # Match all coordinate pairs in the format (x y)
    pattern = r"\(([^)]+)\)"
    match = re.search(pattern, linestring)
    if not match:
        raise ValueError("Invalid LINESTRING format")

    # Extract and split the coordinates
    coord_string = match.group(1)
    coordinates = [tuple(map(float, coord.split())) for coord in coord_string.split(',')]
    return coordinates

# Function to plot LINESTRING data
def plot_linestring(linestring_data):
    """
    Plots the LINESTRING data using matplotlib.
    :param linestring_data: A string containing the LINESTRING data.
    """
    # Extract coordinates
    coordinates = extract_coordinates(linestring_data)

    # Separate the coordinates into two lists for plotting
    x_coords, y_coords = zip(*coordinates)

    # Plot the coordinates using matplotlib
    plt.figure(figsize=(10, 6))
    plt.plot(x_coords, y_coords, marker='o', linestyle='-', color='blue', label="Line Path")
    plt.title("Plot of LineString")
    plt.xlabel("Longitude")
    plt.ylabel("Latitude")
    plt.legend()
    plt.grid(True)
    plt.show()

